import $ from "jquery";

cpuUtilization = () => {
  const data = {

  }

  $.get("http://localhost:4000/cpuUsage", data, (response) => { })
};

function ResourceUsageBar() {
    return (

        <div id="resource-usage-bar">
            <Resource 
            imgPath={"#"}
            usageMetric={getCpuUtilization()}
            resourceName={"CPU"}
          />
    
          <Resource 
            imgPath={"#"}
            usageMetric={"13%"}
            resourceName={"MEM"}
          />
    
          <Resource 
            imgPath={"#"}
            usageMetric={"20GB"}
            resourceName={"Free"}
          />
        </div>

    );
}

export default ResourceUsageBar;
